import React, { Fragment } from 'react';
import SearchBox from './SearchBox';
import CardList from './CardList';

const App = () => {
	return (
		<Fragment>
			<h1>Robo Friends</h1>
			<SearchBox />
			<CardList />
		</Fragment>
	);
};

export default App;
